import React, { useState } from 'react';
import '../CSS/Settings.css';

//add species and simulate button
//rat counter updated for total # rats across the species.  
//food counter
//List of lists. Each list is a species with 6 items (5 brain settings and nums_rats). 

function Settings() {
    //const [ratCount, setRatCount] = useState(0); 

    const [firstCount, setFirstCount] = useState(1); 

    const handleSliderChange = (event) => {
        console.log(event.target.value)
        setFirstCount(parseInt(event.target.value)); 
    };

    return (
        <div class = "settings-modal">
            <h3>Settings</h3>
            <div class="setting-one"> 
                <div className="slidecontainer">
                    <input
                        type="range"
                        min="1"
                        max="100"
                        value={firstCount} 
                        className="slider"
                        id="myRange"
                        onChange={handleSliderChange} // Handle value change
                    />
                    <p>Value: {firstCount}</p>
                </div>

            </div>
        </div>
    );
}

export default Settings;



















